import styled from 'styled-components';

export const ContentContainerStyled = styled.div`
	position: relative;
	display: flex;
	overflow-y: scroll;
	overflow-x: hidden;
	min-height: calc(100% - 120px);
	flex-direction: column;
	width: 100%;
`;
